import React, { Component } from "react";
import GeneralInfo from "./GeneralInfo";

export class CompletedForm extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <>
        <div>{this.props.firstName}</div>
      </>
    );
  }
}

export default CompletedForm;
